  "prompt": "A set of three flame-resistant workwear items designed for oilfield or industrial use, each with more subtle and smaller humorous text placements. The garments include a navy FR button-down with a small chest label reading 'Emotional Support Loop', a sand-colored jacket with a small inner collar print reading 'Made for Heat – Emotional and Otherwise', and a dark gray coverall with a subtle left pocket embroidery: 'Walking HR Violation'. The aesthetic is rugged and authentic, with tasteful satire embedded in functional clothing design. Displayed on a clean neutral background.",
