{
  "prompt": "Design a set of custom flame-resistant workwear garments catered specifically to oil field workers, branded under the name 'TOOL BAG.' The designs include a beige work shirt, a navy hoodie, and a brown canvas jacket. Each features unique, witty slogans tailored to the oilfield culture, such as: 'Tool Bag – Crude But Effective,' 'Spillin’ Tools & Trauma,' and 'Gas Up, Grow Up.' One shirt has a graphic of a tool bag spilling out absurd items like a plunger, a rubber duck, a broken vape, and a glittery wrench. The style is functional but irreverent, mixing real workwear utility with ironic, attention-grabbing flair. Text and logos are smaller and more integrated into the garment design, using patches, sleeve tags, and chest prints.",
